(def aardvark-content [:div {:id "page-content"} [:p {} "Medium sized insectivore with a protruding nasal implement."] [:p {} "One of the more significant scientific discoveries to come out of OD-117 is that it follows the universal constant of Aardvark" [:sup {:class "footnoteref"} [:a {:shape "rect", :class "footnoteref", :id "footnoteref-1", :href "javascript:;", :onclick "WIKIDOT.page.utils.scrollToReference('footnote-1')"} "1"]] "."] [:p {} "This is of particular curiosity because the isolation of the Maelstrom means that independent evolution is the only plausible explanation."] [:p {} "As with most strains the OD-117 Aardvarks do possess some planetary uniquenessï¿½s. Of note their claws are between 10% and 15% longer than the average for the sector. This added length is an advantage when foraging for their preferred prey of Plasma Ants[1]." [:br {:clear "none"}] "\nThey are also significantly more communal than many other planetary subspecies. It is believed that a single burrow network exists that extends across the whole of the continent of Parasumatra[2]. While individuals and couples dig separate courting burrows they always join to the communal burrow before giving birth."] [:p {} "Author: " [:a {:shape "rect", :href "/prof-cuthburt-robinson-smithe"} "Prof. Cuthburt Robinson Smithe"]] [:p {} "Citations: " [:a {:shape "rect", :href "/plasma-ants"} "Plasma Ants"] [:a {:shape "rect", :href "/parasumatra"} "Parasumatra"]] [:div {:class "footnotes-footer"} [:div {:class "title"} "Footnotes"] [:div {:class "footnote-footer", :id "footnote-1"} [:a {:shape "rect", :href "javascript:;", :onclick "WIKIDOT.page.utils.scrollToReference('footnoteref-1')"} "1"] ". Whereby in defiance of all evolutionary logic or reason the common Aardvark has been found on every inhabitable planet know to science."]]])
